        private static void CarregarTabela(string pNomeDoArquivo, string[] pConteudoDoarquivo)
        {
            string lNomeDaTabela = Path.GetFileNameWithoutExtension(pNomeDoArquivo);

            DataTable lTabela = new DataTable(lNomeDaTabela);
            DataRow lRow;

            string[] lValores;
            string lSubValor, lNomeDoCampo;
            Type lTipo;

            lValores = pConteudoDoarquivo[0].Split(";".ToCharArray(), StringSplitOptions.RemoveEmptyEntries);

            foreach (string lCampo in lValores)
            {
                //espera que a linha tenha o formato [NomeDoCampo (tipo);]

                lSubValor = lCampo.Trim();

                lNomeDoCampo = lSubValor.Substring(0, lSubValor.IndexOf(" "));

                lSubValor = lSubValor.Substring(lSubValor.IndexOf('(') + 1);
                lSubValor = lSubValor.TrimEnd(';', ')');

                if (!lSubValor.StartsWith("System"))
                    lSubValor = "System." + lSubValor;

                lTipo = Type.GetType(lSubValor);

                lTabela.Columns.Add(new DataColumn(lNomeDoCampo, lTipo));
            }

            for (int a = 1; a < pConteudoDoarquivo.Length; a++)   //pula a primeira linha
            {
                try
                {
                    lSubValor = pConteudoDoarquivo[a].Trim();

                    if (!string.IsNullOrEmpty(lSubValor))
                    {
                        lValores = lSubValor.Split(";".ToCharArray(), StringSplitOptions.RemoveEmptyEntries);

                        lRow = lTabela.NewRow();

                        for (int b = 0; b < lValores.Length; b++)
                        {
                            lRow[b] = Convert.ChangeType(lValores[b].Trim(), lTabela.Columns[b].DataType);
                        }

                        lTabela.Rows.Add(lRow);
                    }
                }
                catch { }
            }

            gDataSetDeMocks.Tables.Add(lTabela);
        }

        private static void CarregarTabelas()
        {
            gDataSetDeMocks = new DataSet();

            try
            {
                string[] lArquivosDeMock = Directory.GetFiles(Path.Combine(AppDomain.CurrentDomain.BaseDirectory, "bin\\Mocks"), "*.mock");

                foreach (string lArquivo in lArquivosDeMock)
                {
                    try
                    {
                        string[] lConteudo = File.ReadAllLines(lArquivo);

                        CarregarTabela(lArquivo, lConteudo);
                    }
                    catch { }
                }
            }
            catch { }
        }

